import React from 'react';
import Nav from '../components/Nav';
import '../css/nav.css';


const Login = () => {
    return (
        <div>
            
           <div className="inscription">
             <article>
                 <input type="e-mail" placeholder='adresse@mail.com'/>
                 <input type="password" placeholder='Mot de passe'/>
             </article>
           </div>
        </div>
    );
};

export default Login;
